import React from "react";
import { ContainerS1,ContainerLeft,ContainerRight,Titulo,Icone} from "./styles";
import Imagem from "../../../assets/img/img-s1.svg"

export default function S1(){
    return(
        <ContainerS1>
            <ContainerLeft>
                <Titulo> 
                    Rachi, é tudo que você precisa em um só lugar.
                </Titulo>
                <Icone>
                    <i class="fas fa-shapes"></i>
                </Icone>
            </ContainerLeft>
            <ContainerRight>
                <Img src={Imagem}/>
            </ContainerRight>
        </ContainerS1>
    )
}
